import React from 'react'
import styled from "styled-components";
function Header() {
    return (
        <Container>
               <img  src="/images/logo.svg" alt=""/>
        </Container>
    )
}

export default Header

const Container = styled.div `
    max-width:60px;
    position:fixed;
    padding:20px ;
    display-flex;

`
